import React, { useState } from 'react';

const Portfolio = () => {
  const [activeFilter, setActiveFilter] = useState('all');

  const portfolioItems = [
    {
      id: 1,
      title: 'NeoBank App',
      description: 'A complete redesign of the mobile banking experience, focusing on financial wellness and simplified transaction flows for Gen Z users.',
      category: 'ux-ui',
      tags: ['Fintech', 'App'],
      gradient: 'from-purple-100 to-blue-50 dark:from-gray-800 dark:to-gray-900',
      bgElement: (
        <>
          <svg className="absolute bottom-0 right-0 w-64 h-64 text-purple-200 dark:text-gray-700 opacity-50 transform translate-x-1/4 translate-y-1/4" fill="currentColor" viewBox="0 0 200 200">
            <circle cx="100" cy="100" r="100"></circle>
          </svg>
          <div className="absolute top-8 right-8 w-24 h-24 border-[12px] border-blue-200 dark:border-gray-600 rounded-full opacity-60"></div>
        </>
      )
    },
    {
      id: 2,
      title: 'Analytics Pro',
      description: 'Developing a comprehensive data visualization tool for enterprise clients to monitor real-time metrics and generate automated reports.',
      category: 'strategy',
      tags: ['SaaS', 'Dashboard'],
      gradient: 'from-orange-100 to-red-50 dark:from-gray-800 dark:to-gray-900',
      bgElement: (
        <svg className="absolute top-0 left-0 w-full h-full text-orange-200 dark:text-gray-700 opacity-40" fill="none" viewBox="0 0 400 300">
          <path d="M0 300 L400 0 L400 300 Z" fill="currentColor"></path>
        </svg>
      )
    },
    {
      id: 3,
      title: 'EcoTrack',
      description: 'User research and prototyping for a carbon footprint tracking application designed to gamify sustainable living habits.',
      category: 'research',
      tags: ['Sustainability', 'Research'],
      gradient: 'from-green-100 to-emerald-50 dark:from-gray-800 dark:to-gray-900',
      bgElement: (
        <div className="absolute inset-0 flex items-center justify-center opacity-30">
          <div className="w-48 h-48 border-4 border-green-300 dark:border-gray-600 rounded-full"></div>
          <div className="absolute w-32 h-32 border-4 border-green-300 dark:border-gray-600 rounded-full"></div>
        </div>
      )
    },
    {
      id: 4,
      title: 'Fashion Forward',
      description: 'Defining the product strategy and omni-channel experience for a high-end fashion retailer\'s digital transformation.',
      category: 'strategy',
      tags: ['E-commerce', 'Strategy'],
      gradient: 'from-yellow-100 to-amber-50 dark:from-gray-800 dark:to-gray-900',
      bgElement: (
        <div className="absolute bottom-[-20%] left-[-10%] w-[150%] h-[50%] bg-yellow-200 dark:bg-gray-700 rotate-12 opacity-40"></div>
      )
    }
  ];

  const filterButtons = [
    { id: 'all', label: 'All Work' },
    { id: 'ux-ui', label: 'UX/UI' },
    { id: 'strategy', label: 'Product Strategy' },
    { id: 'research', label: 'Research' }
  ];

  const filteredItems = activeFilter === 'all' 
    ? portfolioItems 
    : portfolioItems.filter(item => item.category === activeFilter);

  const handleFilterChange = (filter) => {
    setActiveFilter(filter);
  };

  return (
    <section id="portfolio" className="relative z-10 w-full max-w-7xl mx-auto px-6 pt-8 pb-24">
      <div className="flex flex-col lg:flex-row justify-between items-end mb-16 gap-8">
        <div className="max-w-2xl">
          <h1 className="font-display text-5xl md:text-6xl font-bold mb-6 leading-tight">
            Selected <br/>
            <span className="text-outline">Works</span> & Cases
          </h1>
          <p className="text-lg text-gray-600 dark:text-gray-400 leading-relaxed">
            A showcase of my journey in product design, focusing on user-centric solutions and strategic impact across various industries.
          </p>
        </div>
        
        <div className="flex flex-wrap gap-3">
          {filterButtons.map(button => (
            <button
              key={button.id}
              onClick={() => handleFilterChange(button.id)}
              className={`px-5 py-2.5 rounded-full font-display font-medium text-sm transition-all hover:-translate-y-1 shadow-md ${
                activeFilter === button.id
                  ? 'bg-black text-white dark:bg-white dark:text-black'
                  : 'border border-gray-300 dark:border-gray-700 hover:border-black dark:hover:border-white text-gray-600 dark:text-gray-300'
              }`}
            >
              {button.label}
            </button>
          ))}
        </div>
      </div>
      
      <div className="grid grid-cols-1 md:grid-cols-2 gap-x-12 gap-y-20">
        {filteredItems.map((item, index) => (
          <article 
            key={item.id}
            className={`portfolio-item group cursor-pointer flex flex-col h-full ${
              index % 2 === 1 ? 'md:mt-24' : ''
            }`}
          >
            <div className="relative overflow-hidden rounded-3xl aspect-[16/10] bg-gray-100 dark:bg-gray-800 mb-8 shadow-sm group-hover:shadow-2xl transition-all duration-500 border border-gray-100 dark:border-gray-800">
              <div className={`absolute inset-0 bg-gradient-to-br ${item.gradient} transition-transform duration-700 group-hover:scale-105`}>
                {item.bgElement}
              </div>
              <div className="absolute top-6 left-6 flex flex-wrap gap-2">
                {item.tags.map(tag => (
                  <span 
                    key={tag}
                    className="bg-white/90 dark:bg-black/60 backdrop-blur px-3 py-1 rounded-full text-xs font-bold uppercase tracking-wider shadow-sm text-gray-800 dark:text-gray-200"
                  >
                    {tag}
                  </span>
                ))}
              </div>
            </div>
            
            <div className="flex-grow">
              <div className="flex justify-between items-start mb-3">
                <h3 className="font-display text-3xl font-bold text-gray-900 dark:text-white group-hover:text-gray-600 dark:group-hover:text-gray-300 transition-colors">
                  {item.title}
                </h3>
                <div className="w-10 h-10 rounded-full border border-gray-200 dark:border-gray-700 flex items-center justify-center group-hover:bg-black group-hover:border-black dark:group-hover:bg-white dark:group-hover:border-white transition-all duration-300">
                  <span className="material-icons text-xl transform -rotate-45 group-hover:rotate-0 transition-transform duration-300 text-gray-400 group-hover:text-white dark:group-hover:text-black">
                    arrow_forward
                  </span>
                </div>
              </div>
              <p className="text-gray-600 dark:text-gray-400 mb-6 leading-relaxed max-w-md">
                {item.description}
              </p>
            </div>
            
            <div className="pt-5 border-t border-gray-200 dark:border-gray-800 flex items-center gap-2 text-sm font-bold uppercase tracking-wide group-hover:text-gray-600 dark:group-hover:text-gray-300 transition-colors">
              View Case Study
            </div>
          </article>
        ))}
      </div>
      
      <div className="mt-32 pt-16 border-t border-gray-200 dark:border-gray-800 text-center">
        <p className="text-gray-500 dark:text-gray-400 mb-6 text-lg font-light">
          Interested in working together?
        </p>
        <a 
          className="inline-block font-display text-5xl md:text-7xl font-bold text-black dark:text-white hover:text-gray-600 dark:hover:text-gray-300 transition-colors tracking-tight" 
          href="#contact"
        >
          Let's start a project
        </a>
      </div>
    </section>
  );
};

export default Portfolio;
